webpackJsonp([0x93d3f266370e],{7558:function(t,e){t.exports={data:{post:{html:'<p>Everyone is <a href="http://www.olbertz.de/archives/000695.html">publishing</a> <a href="http://expat-odyssey.blogspot.com/2006/02/confessions-of-faschingsmuffel.html">Karneval</a> <a href="http://justcallmemausi.blogspot.com/2006/02/hannover-helau.html">pictures</a> <a href="http://lumma.de/eintrag.php?id=2549">today</a>! Here\'s Kamelle (candy) being tossed to the crowd of eager kids.</p>\n<p><a href="http://www.flickr.com/photos/papascott/105342798/" title="Photo Sharing"><img src="http://static.flickr.com/34/105342798_1cd2d6019b_m.jpg" width="240" height="180" alt="IMG_1318" /></a></p>\n<p>The parade participants are lining up.</p>\n<p><a href="http://www.flickr.com/photos/papascott/105349145/" title="Photo Sharing"><img src="http://static.flickr.com/34/105349145_9c8f38b6c1_m.jpg" width="240" height="180" alt="IMG_1328" /></a></p>\n<p>More pictures of <a href="http://flickr.com/photos/papascott/tags/nindorfkarneval/show/">Karneval in Nindorf</a>!</p>\n<p>(In case you missed the irony tag, these aren\'t really Karneval pictures. Karneval isn\'t celebrated in northern Germany. These are from our visit to the WildPark in Nindorf yesterday.)</p>',fields:{title:"Karneval in Nindorf",date:"27 Feb 2006",url:"https://papascott.de/2006-02-27-karneval-in-nindorf/"}}},pathContext:{slug:"/2006-02-27-karneval-in-nindorf/",prev:{fields:{title:"All Jabber transports suck",date:"27 Feb 2006",slug:"/2006-02-27-all-jabber-transports-suck/"}},next:{fields:{title:"Myth and Reality",date:"28 Feb 2006",slug:"/2006-02-28-myth-and-reality/"}}}}}});
